clear all

T=4;
t=0.002;
time=0:t:(T);

x_desired = 0.05*cos(0.5*pi*time);
y_desired = 0.05*sin(0.5*pi*time);
position_desired = zeros(3,(T/t+1));
velocity_desired = zeros(3,(T/t+1));
velocity_desired(1:2,:) = [-0.05*0.5*pi*sin(0.5*pi*time);...
                            0.05*0.5*pi*cos(0.5*pi*time)];

angles = zeros(7,(T/t+1),70);
angles_dot = zeros(7,(T/t+1),70);

angleRanges = [-1.7016, 1.7016;
               -2.147,  1.047;
               -3.0541, 3.0541;
               -0.05,   2.618;
               -3.059,  3.059;
               -1.5707, 2.094;
               -3.059,  3.059];
           
anglesStart = angleRanges(:,1) + 0.2*(angleRanges(:,2) - angleRanges(:,1));
for i=1:1:10
% anglesStart(:,i) = angleRanges(:,1) + 0.2*(angleRanges(:,2) - angleRanges(:,1));
anglesStart(:,i) = angleRanges(:,1) + (0.1 + 1/qSweep*i)*(angleRanges(:,2) - angleRanges(:,1));
end

syms theta1 theta2 theta3 theta4 theta5 theta6 theta7
initialAngles = [theta1;
                 theta2;
                 theta3;
                 theta4;
                 theta5;
                 theta6;
                 theta7];
             
DHTable = [0,               0, 0.2703, initialAngles(1,1);...
           0.069,      -1.571,      0, initialAngles(2,1);...
           0,           1.571, 0.3644, initialAngles(3,1);...
           0.069,      -1.571,      0, initialAngles(4,1);...
           0,           1.571, 0.3743, initialAngles(5,1);...
           0.01,       -1.571,      0, initialAngles(6,1);...
           0,           1.571, 0.2295, initialAngles(7,1)];
       
s0_T_s1 = transformationMatrix(DHTable, 1);
s1_T_e0 = transformationMatrix(DHTable, 2);
e0_T_e1 = transformationMatrix(DHTable, 3);
e1_T_w0 = transformationMatrix(DHTable, 4);
w0_T_w1 = transformationMatrix(DHTable, 5);
w1_T_w2 = transformationMatrix(DHTable, 6);
w2_T_ee = transformationMatrix(DHTable, 7);
s0_T_ee = s0_T_s1*s1_T_e0*e0_T_e1*e1_T_w0*w0_T_w1*w1_T_w2*w2_T_ee;

Px_s0_T_ee = s0_T_ee(1,4);
Py_s0_T_ee = s0_T_ee(2,4);
Pz_s0_T_ee = s0_T_ee(3,4);
P_s0_T_ee = [Px_s0_T_ee;...
             Py_s0_T_ee;...
             Pz_s0_T_ee];

s0eeJacobian(1,:) = jacobian(Px_s0_T_ee, [theta1, theta2, theta3, theta4, theta5, theta6, theta7]);
s0eeJacobian(2,:) = jacobian(Py_s0_T_ee, [theta1, theta2, theta3, theta4, theta5, theta6, theta7]);
s0eeJacobian(3,:) = jacobian(Pz_s0_T_ee, [theta1, theta2, theta3, theta4, theta5, theta6, theta7]);
         
n = 1;
for j=1:1:7
    k = 1;
    while k<=10
        anglesInit(:,n) = anglesStart(:,1);
        anglesInit(j,n) = anglesStart(j,k);
        k = k + 1;
        n = n + 1;
    end
end

% angles(:,1) = anglesStart1(:,1);
% pos_ee(:,1) = updatePos_ee(angles(:,1));

for j=1:1:70
    angles(:,1,j) = anglesInit(:,j);
    pos_ee(:,1,j) = updatePos_ee(angles(:,1,j));

    for i=2:1:(T/t+1)
        angles(:,i,j) = angles(:,i-1,j) + angles_dot(:,i-1,j) * t;
        pos_ee(:,i,j) = updatePos_ee(angles(:,i,j));
        jacobian = updatejacobian(angles(:,i,j));
        InvJacobian = pinv(jacobian);
        angles_dot(:,i,j) = InvJacobian*velocity_desired(:,i);
    end

end

